import "./TaskCard.css";

const TaskCard = (task) => {
    return (
        <div className='TaskCard'>
            <div className='TaskCard_task'>{task} Create the product backlog tracker.</div>
            <div>
                <input name='radio' type='radio'/>
            </div>
        </div>
    );
}

export default TaskCard;
